import React from "react"
import ReactDOM from "react-dom/client"
import "./style.css"

const root = ReactDOM.createRoot(document.getElementById("root"))

function Navbar()
{
  return(
    <nav>
      <h1>Perfumy</h1>
      <ul>
        <li>Home |</li>
        <li>Products |</li>
        <li>About |</li>
        <li>Contact</li>
      </ul>
    </nav>
  )
}

root.render()
